text:
Hi HN,<p>I tried editing a subdomain&#x27;s CNAME record and it was not editable (API returned &quot;Duplicate entry&quot;). So I deleted that record and tried creating again. Same error. Now our old record is gone and I can&#x27;t create new one. I spoke with the support and they created a record for `subdomain.example.com.example.com` instead of `subdomain.example.com` from backend (lol).
When I pointed it out, they politely said they cant do anything about it .<p>Now I can do nothing to revert what I did. This was a subdomain used by few people in the company  so it didn&#x27;t cause any major problems. But it would have been disastrous otherwise(Some of our pings are already failing).<p>We will be transferring the domain to another registrar ASAP.<p>I would recommend anyone having a GoDaddy domain to transfer to another registrar. More examples: https:&#x2F;&#x2F;old.reddit.com&#x2F;r&#x2F;godaddy&#x2F;top&#x2F;
Rant over.
